import React, { useState } from 'react'
import { useLocation, useParams } from 'react-router';

function LoggedIn (){

    const {valid, search} = useLocation(); //pass prop using link from navbar.js, access by using 'valid'

    const getCredentials = ()=> JSON.parse(localStorage.getItem('credentials') || "[]");
    const getDetails = () => JSON.parse(localStorage.getItem('details') || "[]")
    const getInput = () => localStorage.getItem('userinput')

    return(
        <div>
            {
                (
                    ()=>{
                        if (getInput.valid){
                            return(
                                <div>
                                    <h1>
                                        Login is successful
                                    </h1>
                                </div>
                            )
                        }
                        else{
                            return(
                                <div>
                                    <h1>Login Failed</h1>
                                </div>
                            )
                        }
                    }
                )()
            }
        </div>
    )
}

export default LoggedIn;
